import React from 'react';
import CSV from '../data/guest_list_csv.csv';

class ReadCSV extends React.Component {

    componentDidMount() {
        const test = this.readTextFile(CSV);
        console.log(CSV);
    }

    render() {
        return <div>Read CSV</div>
    }
}

export default ReadCSV;
